import './App.css';
import {BrowserRouter as Router, Route} from "react-router-dom";

import { CreateAccount } from './components/CreateAccount';
import { Login } from './components/Login';
import { Welcome } from './components/Welcome';
import { ShowAccounts } from './components/ShowAccounts';
import { Page1 } from './lab10/Page1';
import { Page2 } from './lab10/Page2';
import { BookList } from './lab10/BookList';
import { Book2AddPage } from './lab10/Book2AddPage';

function App() {
  return (
      <div>
        <Router>
          <Route exact path={["/"]} component={CreateAccount} />
          <Route path="/login" component={Login} />
          <Route path="/welcome" component={Welcome} />
          <Route path="/showaccounts" component={ShowAccounts} />
          <Route path="/page1" component={Page1} />
          <Route path="/page2" component={Page2} />
          <Route path="/booklist" component={BookList} />
          <Route path="/book2addpage" component={Book2AddPage} />

        </Router>
      </div>
  );
}
export default App;
